import { useState } from "react";
import { useEffect } from "react";
function ContactUs() {
  return (
    <>
      <div className="container">
        <div className="row">
          <form action="">
            <input
              type="text"
              name=""
              id=""
              placeholder="Name"
              className="form-control"
            />
            <input type="number" className="form-form-control"  placeholder=""/>
          </form>
        </div>
      </div>
    </>
  );
}
export default ContactUs;
